-- Delete tables if they exist
DROP TABLE IF EXISTS `AAID`;
DROP TABLE IF EXISTS `METADATASTATEMENT`;
DROP TABLE IF EXISTS `TRUSTEDFACET`;
DROP TABLE IF EXISTS `REGISTRATIONRECORD`;
DROP TABLE IF EXISTS `AUTHENTICATIONID`;

-- Create and Insert AAIDs
CREATE TABLE IF NOT EXISTS `AAID` (
	ID INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY,
	NAME VARCHAR(255) UNIQUE
);


-- Create and Insert Metadata Statements
CREATE TABLE IF NOT EXISTS `METADATASTATEMENT` (
	ID INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY,
	AAID VARCHAR(255) UNIQUE,
	STATEMENT TEXT
);


-- Create and Insert Trusted Facet
CREATE TABLE IF NOT EXISTS `TRUSTEDFACET` (
	ID INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY,
	DESCRIPTION VARCHAR(255),
	NAME VARCHAR(255) UNIQUE
);


-- Create Registration record
CREATE TABLE IF NOT EXISTS `REGISTRATIONRECORD` (
	ID INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY,
	AUTHENTICATOR VARCHAR(255) UNIQUE,
	RECORD TEXT,
	TIMESTAMP VARCHAR(255)
);

-- Create Authentication record
CREATE TABLE IF NOT EXISTS `AUTHENTICATIONID` (
	ID INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY,
	AUTHENTICATIONID VARCHAR(255) UNIQUE,
	USERNAME VARCHAR(255),
	TIMESTAMP VARCHAR(255)
);


